import React from 'react';
import { Button, OverlayTrigger, Tooltip } from 'react-bootstrap';

const HRinformation = () => {

  return (
    <div>
      <div className="hr-information-thumb">
        <span className="hr-information-thumbTxt">호정</span>
      </div>
      <div className="hr-information-profile">
        <p className="hr-information-name">안호정</p>
        <div className="user-json">
          <span>연구원</span>
          <span>·</span>
          <span>개발팀</span>
        </div>
        <div>

            <OverlayTrigger
              key='bottom'
              placement='bottom'
              overlay={
                <Tooltip id={`tooltip-bottom`}>
                  Tooltip on <strong>bottom</strong>.
                </Tooltip>
              }
            >
              <Button variant="secondary">Tooltip on bottom</Button>
            </OverlayTrigger>

        </div>
      </div>
    </div>
  );
}

export default HRinformation;
